import "./styles.css";

export default function App() {
  const cardsConfig = [
    {
      title: "Backlog",
      colorCode: "blue",
      empty: false,
      cardRows: [
        {
          cardTags: [
            {
              title: "iOS",
              colorCode: "black",
            },
          ],
          cardTitle: "Add splash screen",
          cardDesc: "Use company logo",
          DocumentLink: "",
        },
        {
          cardTags: [
            {
              title: "iOS",
              colorCode: "black",
            },
          ],
          cardTitle: "Add splash screen",
          cardDesc: "Use company logo",
          DocumentLink: "",
        },
      ],
    },
    {
      title: "To Do",
      colorCode: "green",
      empty: true,
    },
    {
      title: "In Development",
      colorCode: "brown",
      empty: true,
    },
    {
      title: "Completed",
      colorCode: "purple",
      empty: true,
    },
  ];

  const fetchSearchResults = (event) => {
    console.log("val : ", event.target.value);
  };
  return (
    <div className="App">
      <h1>Kanban Board</h1>
      <div className="search-tags-container">
        <input
          placeholder="search this board"
          name="search"
          value="search"
          onKeyDown={fetchSearchResults}
        ></input>
        <div className="tags">Tags</div>
      </div>
      <div className="cards-container"></div>
    </div>
  );
}
